import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import AddProducto from "./productos/AddProducto";
import EditProducto from './productos/EditProducto';
import ViewProducto from "./productos/ViewProducto";
import SobreNosotros from "./pages/SobreNosotros";

function App() {
    return (
        <div className="App">
            <Router>
                <Navbar />
                <Route exact path="/" component={Home} />
                <Route exact path="/addproducto" component={AddProducto} />
                <Route exact path="/editproducto/:id" component={EditProducto} />
                <Route exact path="/viewproducto/:id" component={ViewProducto} />
                <Route exact path="/sobrenosotros" component={SobreNosotros} />
            </Router>
        </div>
    );
}

export default App;
